import React from "react";
import ProfileCard from "./components/ProfileCard.js";

function App() {
  const ProfileCard = [
    {
      name: "Rajesh",
      age: "20",
      location: "44 Charles",
    },
  ];
  return (
    <>
      <ProfileCard
        name={ProfileCard.name}
        age={ProfileCard.age}
        location={ProfileCard.location}
      />
    </>
  );
}

